import React from 'react';
import EnrollForm from '../components/EnrollForm';

const Home = () => {
  return (
    <div style={styles.container}>
      <h1>Welcome to Techcloud Academy</h1>
      <p>Learn the latest technologies and advance your career.</p>
      <EnrollForm />
    </div>
  );
};

const styles = {
  container: {
    padding: '20px',
    textAlign: 'center',
  },
};

export default Home;
